      type: 'scatter',
      name: 'Deaths'
  });
  var layout = {
    title: 'Accumulated Coronavirus cases in Venezuela (VE)',
    yaxis: {
       title: 'Accumulated number of cases'
    }
  };
  Plotly.newPlot('graph_accu_ve', traces, layout, {
      displaylogo: false,
      modeBarButtonsToRemove: ['sendDataToCloud']
  });
</script>
